import React from "react";
import { View, Text } from "react-native";


const ResultIMC = ({ messageImc, textButton }) => {
    return (
        <View>
            <Text>{messageImc}</Text>
            <Text>{textButton}</Text>
        </View>
    );
};

export default ResultIMC
